import Box from '@mui/material/Box';

function Signin(){

    return(

        <Box
      sx={{
        width: 850,
        height: 500,
        position:'relative',
        left:400,
        top:250,

        border:'2px solid red'
         }}>
             <Box sx={{
                    width:'60%',
                    height:'70%',
                    border:'1px solid green'

             }}>

             </Box>
        </Box>
    )

}
export default Signin
